ListNode* reverseList(ListNode* head) {
        
        ListNode* cur = head;
        
        ListNode* prev = NULL;
        ListNode* next = NULL;
        
        // Reverse the Linked List starting from (n / 2)th node in original Linked List
        while(cur != NULL) {
            
            next = cur->next;
            cur->next = prev;
            
            prev = cur;
            cur = next;
        }
        
        return prev;
    }

